import React, { useState, useEffect } from 'react'

function Graveyard() {
    const [deadHeroes, setDeadHeroes] = useState([])

    useEffect(()=>{fetch('http://localhost:9393/heros/dead')
    .then(r=>r.json())
    .then(setDeadHeroes)}
    ,[])

    console.log(deadHeroes)

  return (
    <div>Graveyard</div>
  )
}

export default Graveyard
